import React from 'react';
import Header from './Header';
import Main from './components/Main';
import Footer from './components/Footer';
import './App.css';

function App() {
  return (
    <div className="portfolio-container">
      <Header />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
